          constructor(props){
              super(props);
              this.state={
                  dater:function(v){return (<div>{v}</div>)},
                  response: (<div>skdsjka</div>)
              }

          }


          good=function (){

               }

    render() {
        if (!this.state.response){
            
            return <div>Loading...</div>
        }

        return (
            <div>Proper Stuff</div>
        );

    }



}
TableData.defaultProps={

    tool:"Dagger",
    vehicle:"Amore"
}


class TableHead extends React.Component{

    render() {
        return(<div><tbody><tr><th>Head</th><th>Nose</th></tr></tbody></div>);
    }

}
